Mexico Appleseed, as an independent Mexican non-profit charity (donataria autorizada), has the mission to assist people in need either approaching their particular legal issues or the systemic problems that affect them. In brief, our goal is to empower people in need äóñand the organizations that assist themäóñ with effective opportunities to improve their situation.

