LSC was founded in 1975 as one of the country’s first non-profit law firms dedicated to providing free legal representation and social work services to children and youth. Our mission is to ensure that all children in the San Francisco Bay Area are raised in a safe environment with equal access to a meaningful education and other services that are necessary to thrive and grow. We combine substantive legal expertise with fully integrated social work services that are designed to meet the overlapping needs of each client. LSC pioneered this interdisciplinary approach that is considered best practice in juvenile law today.

