Mexico faces a series of complex and diverse obstacles that directly contribute to the small number of children surviving cancer:&nbsp;
<div><br></div><div>1. Late, inaccurate or underdiagnoses of patients produced by the lack of awareness of the signs and symptoms of child cancer and its curability amongst parents and primary healthcare professionals. Children reach hospitals and commence care in advanced stages of the disease, gravely affecting their prognosis.&nbsp;
<div><br></div><div>2. Patients receive affordable or available care, instead of optimal as a result of limited government funds for healthcare expenditure (Mexico spends 1,062 USD on health per person vs. 8,895 USD spent in America), lack of healthcare professionals (for example, there are 151 pediatric oncologists in Mexico, 4 times less than the amount required), poor infrastructure and lack of resources necessary for managing cancer, the absence of childhood cancer reporting and registration as well as the centralized healthcare system (appropriate treatment is mostly available in MexicoÇs largest cities, for instance Mexico City and Monterrey).</div></div>

The <em>Pathways/Senderos Center</em> serves girls and boys, ages 10-18, from the inner-city, poverty-stricken areas of New Britain. All of the youth are at high risk for becoming teen parents: they come from poor families with undereducated parents (most are Spanish-speaking); the majority have severe academic problems and long-standing negative relationships with the schools; many are siblings of teen parents; and many are children who were born to teen parents.

&nbsp;

Our program is comprehensive and holistic because it is important to make interventions in all aspects of these youngsters lives in order to make positive changes. We have created a center where children feel safe, welcomed and nurtured, so that learning and skill-building occur. In order to interrupt the intergenerational cycles of teen parenting and poverty, our staff strives to develop in each child: the competency and motivation to achieve success and avoid early parenthood, and the capability to envision a pathway to a hopeful future that includes education and careers, rather than parenting too soon.

