As the largest not-for-profit participatory immigrant organization in New York State, with more than 16,000 families and small business members, MRNY is uniquely well-positioned to identify and address pressing community needs. Through its network of community centers across New York City and Long Island, MRNY employs a multi-faceted approach to helping immigrant and low-income New Yorkers through community organizing, policy innovation, education, and legal and survival services.

Every day we welcome hundreds of newcomers to our organization. Some come to sign up for citizenship classes, others for help with a negligent landlord. Often they stay for an LGBTQ rights workshop or a youth poetry slam, sharing the nightly meal with long-time members.  The result is a resilient community that sustains ambitious organizing campaigns while nurturing the leadership and self-sufficiency of individual members.

