&nbsp;

<strong>MISION</strong>

&nbsp;

Somos una Fundación  al  servicio  de la sociedad hondureña, con excelencia en el desarrollo de las artes ,que coadyuven al  desarrollo integral del ser humano, insertándolo a la comunidad  por medio del intercambio, cooperación, valores, identidad nacional, que incide en la transformación del niño, el joven en el entorno familiar, contando con un programa de voluntariado dirigido al logro de metas en común, con disciplina, pasión, formando equipos multidisciplinarios altamente comprometidos e identificados con la institución.

Se reconoce que las artes educativas crean oportunidades para el desarrollo personal en lo intelectual, espiritual, social, profesional, rescatando al niño y al joven de una vida sin propósito.

La misión de nuestra organización es:

Crear una comunidad saludable que sea inclusiva, empoderada y equipada para crear un mundo más justo al promover la participación de la comunidad Latina y desarrollar la capacidad de líderes de base

