Since 2010, 12+ has permeated the halls of Kensington Health Sciences Academy, where the majority of its students are Latino, with a culture of success in postsecondary education. 12+ partners with Kensington to build a college-going culture, working to fill gaps of service through comprehensive programming as well as to redefine what is possible for students. In order to reach all students within the school, 12+ operates a PLUS Center, a vibrant hub for college, career, and academic resources previously unavailable to the student body. Centers highlight achievements and promote a shared sense of belonging within the school.

&nbsp;

&nbsp;

Approximately 100% of students at KHSA live at or below the federal poverty line. Through this whole-school model that includes comprehensive programming for all students within the school, 12+ has been integral in increasing the overall college enrollment rate from 11% in 2010 to over 70% in 2013. In 2015, the rate of college-going seniors in the graduating class was 84%.

&nbsp;

12+ now partners with two additional schools across the School District of Philadelphia.

En Prosperity Works, creemos que un cheque de pago se le alcance, pero los activos se le ponga por delante. Con esto como principio rector, durante los últimos 15 años, a través de cuentas de desarrollo individuales (cuentas de ahorro combinadas con educación financiera y entrenamiento individual en curso y tutoría), hemos ayudado a personas de bajos ingresos adquirir un activo. (Comprar una casa, obtener una educación post-secundaria, iniciar o construir un negocio). Hemos ayudado a 319 familias adquirir vivienda segura y asequible ($ 57 millones en participaciones hipotecarias). Hemos ayudado a 512 residentes ir a la universidad (casi $ 2 millones en la matrícula). Hemos ayudado a los nuevomexicanos abrir o crecer casi 700 empresas locales.

&nbsp;

En 2014, lanzamos Prosperity Kids ™, una estrategia de generación dual, impacto colectivo para mover los niños y sus familias de la pobreza hacia la autosuficiencia y aún la prosperidad. Objetivo edad 0-11 para una cuenta de ahorros, sembrada ($100) y emparejada (hasta $200 al año durante 10 años), en el nombre del niño, guardado por el custodio (PW) con el fin de la educación, suelto al niño a los 18 años para la educación superior o si él o ella no elige utilizarlo así, suelto a la edad 23 para ayudar a proporcionar una transición financieramente estable a la edad adulta. Además de la CSA, los padres tienen acceso a una cuenta de emergencia, desarrollo infantil y cursos de educación financiera, tarjetas de crédito garantizadas, préstamos de ciudadanía y servicios legales.

La iniciativa de CSA de Prosperity Kids ™, es la más sólida que cualquiera en el país y un antídoto muy necesario en nuestro estado por los estragos de la pobreza que sufren muchos latinos, incluyendo inmigrantes.

