Aspire! programming achieves real results for upper elementary school students from low-income households by triangulating key influencers around student success: at school; after school; and at home/ in the community.

&nbsp;

<b>At School</b>: Aspire! has cultivated excellent partnerships with the five public schools where its students are enrolled in south Arlington.  Close collaboration with schools allows Aspire! to provide more tailored support to students, to better understand their challenges and successes, and to align afterschool strategies with the school day. Aspire! staff hold weekly office hours at its five public school partners to share with and solicit information from teachers in support of students’ progress and to ensure that afterschool lessons support school priorities. Aspire! also places AmeriCorps Members in each of its partner schools for six hours/week throughout the year, providing direct services to 500+ students/year in their classrooms.

&nbsp;

<b>After School</b>: Aspire! provides 15 hours of academic and social-emotional support to 80 low- income 3rd, 4th, and 5th grade students each week after school (Monday – Friday) at three sites: Arlington Mill Community Center,  Virginia Gardens Apartments and Buchanan Gardens Apartments.  In addition to homework help, a key function of Aspire!'s Learning ROCKS! program is to improve students’ academic and functional English literacy skills through 30 minutes of dedicated reading activities each day at each site. Our programming utilizes evidence-based methods (e.g. independent reading, Buddy Reading, choral reading, scaffolding, etc.)  to support students’ reading development each day, as well as providing targeted support to students each week (e.g. Guided Reading; Literature Circles).  In  addition to daily reading and homework support, we implement a variety of other project-based, experiential learning opportunities to reinforce key academic content and help students to make connections within and across content.  Finally, our programming also utilizes a variety of behavior management and modeling techniques that directly support the internal developmental assets for middle childhood (Search Institute 2015), fostering students’ ability to “make good choices.”  During the summer, Aspire! implements a six-week summer camp, offering intensive, full-day programming to reinforce academic content and prevent summer learning loss. Summer themes frequently focus on Virginia Standards of Learning topics, allowing students to explore content in richer, more experiential ways than they can during the school day.

&nbsp;

IMPACT: Aspire! is exceptionally qualified to provide this service and builds on a 20 year history of outstanding results. Typically, more than half of students begin the year not reading on target with their respective grade levels. <b>In the last school year (2014-15), Aspire! achieved its best results in the organization’s 20 year history with 92% of students improving their reading instructional levels and nearly two-thirds improving by two or more instructional levels</b> – a considerable achievement for the high-risk students that<b> </b>Aspire! serves who are frequently cited in achievement gap data within the schools.  Additionally, Aspire!'s work has been lauded both locally and nationally, including its Learning ROCKS! Program being recognized as “<b>one of the top 50 arts- and humanities-based programs in the country</b>” by the National Arts &amp; Humanities Youth Program Award through the [US] President’s Committee on the Arts and the Humanities.

Nuestra misión es: Integrar en un ambiente de amor, respeto y paciencia, a mujeres mayores de 65 años en San Luis Potosí que vivan en situación vulnerable. Ofrece un hogar para atenderlas de forma integral rehabilitándolas físicamente, nutriéndolas y alimentando su espíritu para que puedan tener la oportunidad de recuperar su felicidad y la tranquilidad de sus familias.

Hemos atendido en 28 años a 308 abuelitas en un ambiente amoroso y digno viven con nosotros un promedio de 10 años; diariamente buscamos que estén ocupadas todo el tiempo tienen terapia física, atención psicológica y médica así como actividades recreativas y culturales, nuestra labor es hacerlas sentir productivas y que tengan salud emocional y física.

