La misión de La Coalición de Servicios, Derechos, y Educación al Inmigrante (SIREN en inglés) es empoderar a inmigrantes y refugiados de bajos ingresos en Silicon Valley a través de servicios directos, educación comunitaria, desarrollo de liderazgo y abogacía de políticas federales y estatales que afectan a inmigrantes. Creemos que todas las personas, sin importar estatus migratorio o nacionalidad, tienen derecho a servicios esenciales, dignidad humana, protección, y acceso a la participación completa en la sociedad.

Desde su creación, SIREN ha sido la organización líder en derechos de inmigrantes en el Silicon Valley.

