Student Action with Farmworkers is a 501(c)3 non-profit organization whose mission is to bring students and farmworkers together to learn about each other’s lives, share resources and skills, improve conditions for farmworkers, and build diverse coalitions working for social change.

&nbsp;

SAF has been working on education reform, workers’ rights, and health and safety issues since its inception as a nonprofit. SAF develops new leaders in the farmworker movement, builds diverse coalitions, and defends farmworkers’ rights. Every year SAF reaches over 5,000 farmworkers in the Southeastern US, coordinates in-depth leadership programs for 50 young people, and educates the public about current farmworker issues through National Farmworker Awareness Week. Since 1992, SAF has engaged thousands of students in the farmworker movement, while emphasizing the leadership development of Latino students from farmworker families.

