Desde 2012, 12+ ha permeado los pasillos de la Academia de Ciencias de la Salud de Kensington, donde la mayoría de sus estudiantes son latinos, con una cultura de éxito en la educación post-secundaria. 12+ socios con Kensington para construir una cultura universitaria, trabajando para llenar los vacíos de servicio a través de una programación integral, así como redefinir lo que es posible para los estudiantes. Con el fin de llegar a todos los estudiantes dentro de la escuela, 12+ opera un centro PLUS, un centro vibrante para la universidad, la carrera y los recursos académicos antes no estaban disponibles para los estudiantes. Centros de relieve los logros y promueven un sentido compartido de pertenencia dentro de la escuela.

Aproximadamente el 100% de los estudiantes en KHSA viven en o por debajo de la línea federal de pobreza. A través de este modelo de toda la escuela que incluye la programación integral para todos los estudiantes dentro de la escuela, 12+ ha sido esencial en el aumento de la tasa de inscripción en la universidad en general. En 2010, cuando 12+ comenzó como un pequeño programa de tutoría durante nueve personas mayores, el 11% de los mayores de graduación inscribió en la universidad. En 2015, la tasa de mayores de la universidad curso en la clase de graduación fue del 84%. 12+ ahora sirve a más de 1200 estudiantes y socios con dos escuelas adicionales en todo el distrito escolar de Filadelfia.
